import React, { useEffect, useState } from 'react'
import { Link } from 'react-router-dom'
import * as format from '../../apis/format'

const BoardUpdateForm = ({ no, board, onUpdate, onDelete, isLoading }) => {

    // state 설정
    const [title, setTitle] = useState('')
    const [writer, setWriter] = useState('')
    const [content, setContent] = useState('')

    const handleChangeTitle = (e) => {
        setTitle(e.target.value)
    }

    const handleChangeWriter = (e) => {
        setWriter(e.target.value)
    }

    const handleChangeContent = (e) => {
        setContent(e.target.value)
    }

    const onSubmit = () => {
        onUpdate(no, title, writer, content)
    }

    const handleDelete = () => {
        const check = window.confirm('정말로 삭제하시겠습니까?')
        if( check ) 
            onDelete(no)
    }

    useEffect( () => {
        if( board ) {
            setTitle(board.title);
            setWriter(board.writer)
            setContent(board.content)
        }
    }, [board])
//[의존하는객체]


    return (
        <div className='container'>
            <h1 className='title'>게시글 수정</h1>
            <h3>번호 : {no}</h3>
            <hr/>

            { isLoading && 
                <div>
                    <img src="/img/loading.webp" alt="loading" width="100%" />
                </div> 
            }
            { !isLoading && board && (
            <table border={1}>
                <tbody>
                    <tr>
                        <td>번호</td>
                        <td>
                            <input type="text" value={board.no} readOnly />
                        </td>
                    </tr>
                    <tr>
                        <td>등록일자</td>
                        <td>
                            <input type="text" value={ format.formatDate(board.regDate) } readOnly />
                        </td>
                    </tr>
                    <tr>
                        <td>제목</td>
                        <td>
                            <input type="text" value={title} onChange={handleChangeTitle} />
                        </td>
                    </tr>
                    <tr>
                        <td>작성자</td>
                        <td>
                            <input type="text" value={writer} onChange={handleChangeWriter} />
                        </td>
                    </tr>
                    <tr>
                        <td colSpan={2}>내용</td>
                    </tr>
                    <tr>
                        <td colSpan={2}>
                            <textarea   cols="40" rows="10" 
                                    
                                        value={content} 
                                        onChange={handleChangeContent}></textarea>
                        </td>

                    </tr>
                </tbody>
            </table>
            )}
            <hr />
            <div className="btn-box">
                <div className="item">
                    <Link to="/boards" className='btn'>목록</Link>
                </div>
                <div className="item">
                    <button className='btn' onClick={ handleDelete }>삭제</button>
                    <button className='btn' tton onClick={ onSubmit }>수정</button>
                </div>
            </div>
        </div>
    )

}

export default BoardUpdateForm
